function manualSwap() public {
    require(msg.sender == store_p, "Unauthorized: store_p mismatch");
    require(msg.sender == store_q, "Unauthorized: store_q mismatch");

    address contractAddress = address(this);
    uint256 reflectionAmount = storage_map_l[contractAddress];
    require(reflectionAmount <= store_m, "Amount must be less than total reflections");

    uint256 divisor = 0x0de0b6b3a7640000; // 10^18
    require(divisor != 0, "SafeMath: division by zero");

    uint256 divisionResult = store_m / divisor;
    require(store_m >= divisionResult, "SafeMath: multiplication overflow");

    if (divisor != 0) {
        uint256 safeDivisionResult = store_m / divisor;
        require(store_m >= safeDivisionResult, "SafeMath: multiplication overflow");
    }
}

